  {number: "5149-36", name: "Loyalton Collection ", description: "Traditional elements of wood and metal blend to create the casual look of the Loyalton Collection. Forged of metal, the double-X patterns flow from chair back to table apron, while the traditional look of the table’s turned legs is given a modern update. Wood is utilized for the tables routed top, chair seats and chair backs. The collection is offered in two distinct styles to fit your needs – 48 inches fixed rectangular top and 40 inches square counter height top.", category: "dining", popularity: 0, related_products: [3310], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-36.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/5149-36_topview.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/5149-36.jpg", avg_price: 45.0},
