  {number: "6472", name: "Amara Collection ", description: "Fun, funky and functional, the Amara Collection will provide your home with interesting conversation pieces and a look that is as unique as you are. With the turn of a crank, the adjustable table (6414) can be raised or lowered to suit your individual needs. Black iron is complimented by the bold red and white hued design of the -\u0080\u009CAtellier Loft-\u0080\u009D print that appears on the dining tabletop and carries its theme to the caster supported cocktail table (6409) -\u0080\u0093 paired with our tractor seat adjustable iron barstool (6412), you will have created the creative focal point for your dining space.", category: "home", popularity: 0, related_products: [4028], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/6472.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/6472.jpg", avg_price: 59.0},
