  {number: "2168WW-1", name: "Orleans II Collection ", description: "An updated look to the grandeur of Old World Europe is flawlessly executed in the Orleans II Collection. Acanthus leaf carvings feature prominently and blend with elegantly appointed moldings on each piece of this stately bedroom. Wreath accents lend dramatic flair to the bed and mirror as does the sculpted lion-\u0080\u0099s foot base, supporting each of the case pieces. Heavy pilasters rise with and are topped with carved finials on the neutral-toned, linen accented headboard and footboard. The washed white and weathered brown two-tone finish lends to the unique styling of this elegant bedroom collection.", category: "bedroom", popularity: 0, related_products: [3321], images: ["https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2168KWW-1.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2168WW-11.jpg", "https://s3-us-west-1.amazonaws.com/homelegance/Images_MidRes_For+Customer+Advertisement/2168WW-9.jpg"], thumbnail: "https://s3-us-west-1.amazonaws.com/homelegance-resized/Images_MidRes_For+Customer+Advertisement/2168KWW-1.jpg", avg_price: 478.0},
